import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import './Expense.css';

const Expense = (props) => {
    const expense = props.expenses.map((item) => 
    <ExpenseItem
      key={item.id}
      title={item.title}
      amount={item.amount}
      date={item.date}
    />
  );

  return(
    <Card className="expenses">
        {expense}
    </Card>
  );
}

export default Expense;
